import React from 'react';

const Announce = () => {
  return (
    <section className={"container"}>
      <div className="row">
        <div className="announce-detail col-12 col-lg-8">
          <div className="title-list">
            <h1>Giảm giá 20% cho toàn bộ manga</h1>
          </div>
        </div>
        <div className="list-announce col-12 col-lg-4"></div>
      </div>
    </section>
  );
};

export default Announce;
